def patternmatching(pattern, genome):
    indexMatch = []
    lenPattern = len(pattern)
    lenGenome = len(genome)
    count = 0
    for i in range(0, lenGenome-lenPattern):
        if (pattern == genome[i:i+lenPattern]):
            count = count + 1
            indexMatch.append(i)
    return indexMatch

